df = pd.DataFrame()
df = pd_df.iloc[0:0]
firstFlag = 0
for index, row in pd_df.iterrows():
    if row['rank'] == 'PLATINUM' or row['rank'] == 'DIAMOND' or row['rank'] == 'MASTER':
        df = pd.concat([df, row.to_frame().T], ignore_index=True)        

#print(df)
x = df.drop(columns="win")

x = x.drop(columns='championName')
x = x.drop(columns='individualPosition')
x = x.drop(columns='lane')
x = x.drop(columns='perks')
x = x.drop(columns='puuid')
x = x.drop(columns='riotIdName')
x = x.drop(columns='riotIdTagline')
x = x.drop(columns='role')
x = x.drop(columns='summonerId')
x = x.drop(columns='summonerName')
x = x.drop(columns='teamPosition')
x = x.drop(columns='rank')

#Below is extranous is the same for both teams. No need to be part of the decision
x = x.drop(columns='nexusLost')
x = x.drop(columns='gameEndedInSurrender')
x = x.drop(columns='gameEndedInEarlySurrender')
x = x.drop(columns='gameId')


# This will always tell the winner:
x = x.drop(columns='teamEarlySurrendered')
x = x.drop(columns='nexusKills')
x = x.drop(columns='nexusTakedowns')

# No map info:
x = x.drop(columns='turretTakedowns')
x = x.drop(columns='turretKills')
x = x.drop(columns='inhibitorKills')
x = x.drop(columns='inhibitorTakedowns')
x = x.drop(columns='inhibitorsLost')
x = x.drop(columns='turretsLost')


y = df['win']
y=y.astype('int')

#print(y)
#print(x.head(10))
from sklearn.tree import DecisionTreeClassifier
from sklearn.model_selection import train_test_split 
x_train, x_test, y_train, y_test = train_test_split(x,y,test_size=0.3,random_state=1)


model = DecisionTreeClassifier()

model = model.fit(x_train,y_train)

y_pred = model.predict(x_test)

from sklearn import metrics
print("Accuracy:",metrics.accuracy_score(y_test,y_pred)*100)

from sklearn.metrics import confusion_matrix
print(confusion_matrix(y_test,y_pred))

from sklearn.metrics import classification_report
print(classification_report(y_test,y_pred))


